/** @format */

import React, { useState } from 'react';
import '../App.css';
import { HealthFluff, HealthListV2, Recipes } from '../TextInfo';
import HealthBlock from '../components/HealthBlock';

const Health = () => {
    const [active, setActive] = useState( 100 );
    const dropdown = ( index ) => {
        if ( active !== index )
            setActive( index );
        else
            setActive( 1000 );
    };
    return (
        <div className='container_pages'>
            <span>
                <div className='filler-text'>
                    <h1 className='title_exp'>You are what you eat</h1>
                    <p className='healthDesc'>{HealthFluff}</p>
                </div>
                <div>
                    <span className='hth_li supplier'>
                        {HealthListV2.map( ( item, index ) => {
                            return (
                                <span key={index} className="healthCard">
                                    <HealthBlock itemi={item} />
                                </span>
                            );
                        } )}
                    </span>
                </div>
                <div className='filler-text'>
                    <h1 className='title_exp'>A weekly menu of tasty and healthy diet</h1>
                    <h1>[with Recipes]</h1>
                    <p className='healthDesc'></p>
                </div>
                <div className="recipeGrid">
                    {Recipes.map( ( item, index ) => {
                        let date = null;
                        ( index < 5 ? date = <p className='recipeDay'>{item.day}</p> : date = null )
                        return (
                            <span key={index} className="recipeBlock" onClick={dropdown}>
                                {date}
                                <p className="annotateP">{item.type}</p>
                                <p className="recipeDish">{item.name}</p>
                            </span>
                        );
                    } )}
                </div>
            </span>
        </div>
    );
};

export default Health;
